  width: "700px",
  height: "500px",
  chartData: [10, 101, 35, 51, 49, 62, 69, 91, 14],
  name: "Mock Name",
  chartLabels: ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep"],
